import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

function Logout({ setCurrentUser }) {
  useEffect(() => {
    fetch("http://localhost:3000/logout", {
      method: "DELETE",
    })
      .then(() => setCurrentUser(null))
      .then(navigate("/home"));
  });
  return <div></div>;
}

export default Logout;
